function clone(o) {
  // null, undefined values check
  if (!o) {
    return o;
  }
  const output = Array.isArray(o) ? [] : {};

  Object.keys(o).forEach((key) => {
    const v = o[key];
    output[key] = (typeof v === 'object') ? clone(v) : v;
  });
  return output;
}

